Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (41,'Java and Algorithmic Thinking for the Complete Beginner: Learn to Think Like a Programmer','B01CGQNPWK.jpg','B01CGQNPWK',16,8,'B01CGQNPWK',41.99,'This book is for anyone who wants to learn computer programming and knows absolutely nothing about it. Of course, if you are wondering whether this book is going to teach you how to create amazing applets or incredible desktop or mobile applications, the answer is "no"¿that is a job for other books. So many books out there can teach you those skills in Java, C++, or C#. Many of them even claim that they can teach you in 24 hours! Don¿t laugh! They probably can do that, but all of them take one thing for ',813,null,4);
