Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (15,'The Wonderful Things You Will Be','thewonderfulthings.jpg','0385376715',23,5,'978-0385376716',14.83,'From brave and bold to creative and clever, Emily Winfield Martin''s rhythmic rhyme expresses all the loving things that parents think of when they look at their children. With beautiful, and sometimes humorous, illustrations, and a clever gatefold with kids in costumes, this is a book grown-ups will love reading over and over to kids—both young and old. A great gift for any occasion, but a special stand-out for baby showers, birthdays, and graduation. The Wonderful Things You Will Be has a loving and truthful message that will endure for lifetimes.',36,null,4);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (19,'Making a Difference: Teaching Kindness, Character and Purpose','makingadifference.jpg','1633535983',28,5,'978-1633535985',11.7,'Kindness, courtesy, respect and purpose: Through positive and motivating text, Making a Difference assures children that they are important, and that what they do matters. Boost your child''s confidence and sense of purpose as you read and affirm that their hopeful thoughts, kind words and good choices can make a difference to themselves and others. Making a Difference is a book that can help build social skills and character, teach life lessons to your children, and put them on a pathway to kindness, courtesy, respect, and purpose.
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (20,'Are You My Mother? (Bright & Early Board Books(TM))','areyoumymother.jpg','0679890475',29,5,'978-0679890478',3.59,'A baby bird goes in search of his mother in this hilarious Beginner Book edited by Dr. Seuss. When a mother bird’s egg starts to jump, she hurries off to make sure she has something for her little one to eat. But as soon as she’s gone, out pops the baby bird. He immediately sets off to find his mother, but not knowing what she looks like makes it a challenge. The little hatchling is determined to find his mother, even after meeting a kitten, a hen, a dog, and a Snort. The timeless message of the bond between',12,null,0);
