Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (31,'Java: A Beginner Guide, Seventh Edition','javaabeginner.jpg','1259589315',4,8,'978-1259589317',25.43,'Supplement for key JDK 10 new features available from book''s Downloads & Resources page at OraclePressBooks.com.
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (32,'Java: The Complete Reference, Tenth Edition (Complete Reference Series)','javacompletereference.jpg','1259589331',4,8,'978-1259589331',38.72,'Fully updated for Java SE 9, Java: The Complete Reference, Tenth Edition explains how to develop, compile, debug, and run Java programs. Bestselling programming author Herb Schildt covers the entire Java language, including its syntax, keywords, and fundamental programming principles. You''ll also find information on key portions of the Java API library, such as I/O, the Collections Framework, the stream library, and the concurrency utilities. Swing, JavaFX, JavaBeans, and servlets are examined and numerous examples demonstrate Java in action. Of course, the new module system added by Java SE 9 is discussed in detail. This Oracle Press resource also offers an introduction to JShell, Java’s new interactive programming tool.',1344,null,null);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (33,'Head First Java, 2nd Edition','headfirstjava.jpg','0596009208',6,8,'978-0596009205',15.26,'Learning a complex new language is no easy task especially when it s an object-oriented computer programming language like Java. You might think the problem is your brain. It seems to have a mind of its own, a mind that doesn''t always want to take in the dry, technical stuff you''re forced to study. 
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (35,'Java All-in-One For Dummies (For Dummies (Computers))','javaallinone.jpg','1119247799',10,8,'978-1119247791',18.49,'If you''ve always wanted to program with Java but didn''t know where to start, this will be the java-stained reference you''ll turn to again and again. Fully updated for the JDK 9, this deep reference on the world''s most popular programming language is the perfect starting point for building things with Java—and an invaluable ongoing reference as you continue to deepen your knowledge.',960,null,null);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (36,'Core Java Volume I--Fundamentals (10th Edition) (Core Series)Jan 1, 2016','corejava10th.jpg','0134177304',1,8,'978-0134177304',18.49,'Core Java® has long been recognized as the leading, no-nonsense tutorial and reference for experienced programmers who want to write robust Java code for real-world applications. Now, Core Java®, Volume I–Fundamentals, Tenth Edition, has been extensively updated to reflect the most eagerly awaited and innovative version of Java in years: Java SE 8. Rewritten and reorganized to illuminate new Java SE 8 features, idioms, and best practices, it contains hundreds of example programs–all carefully crafted for easy understanding and practical ',1040,null,null);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (38,'Data Structures and Algorithms in Java (2nd Edition)','datastructurejava.jpg','0672324539',13,8,'978-0672324536',11.61,'Data Structures and Algorithms in Java, Second Edition is designed to be easy to read and understand although the topic itself is complicated. Algorithms are the procedures that software programs use to manipulate data structures. Besides clear and simple example programs, the author includes a workshop as a small demonstration program executable on a Web browser. The programs demonstrate in graphical form what data structures look like and how they operate. In the second edition, the program is rewritten to improve operation and clarify the algorithms, the example programs are revised to work with the latest version of the Java JDK, and questions and exercises will be added at the end of each chapter making the book more useful to readers.',800,null,2);
