Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (42,'Java Data Analysis: Data mining, big data analysis, NoSQL, and data visualization','978-1787285651.jpg','1787285650',17,8,'978-1787285651',7.9,'Data analysis is a process of inspecting, cleansing, transforming, and modeling data with the aim of discovering useful information. Java is one of the most popular languages to perform your data analysis tasks.
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (8,'Death Be Not Proud (P.S.)','978-0061230974.jpg','0061230979',26,13,'978-0061230974',7.8,'Johnny Gunther was only seventeen years old when he died of a brain tumor. During the months of his illness, everyone near him was unforgettably impressed by his level-headed courage, his wit and quiet friendliness, and, above all, his unfaltering patience through times of despair. This deeply moving book is a father''s memoir of a brave, intelligent, and spirited boy.',224,null,1);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (14,'I Know Why the Caged Bird Sings','iknowwhythecagedbirdsings.jpg','345514408',22,2,'978-0345514400',6.36,'Here is a book as joyous and painful, as mysterious and memorable, as childhood itself. I Know Why the Caged Bird Sings captures the longing of lonely children, the brute insult of bigotry, and the wonder of words that can make the world right. Maya Angelou’s debut memoir is a modern American classic beloved worldwide.',304,null,2);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (17,'Book of the Law',' 978-0877283348.jpg','877283346',26,16,' 978-0877283348',15,'Do what thou wilt shall be the whole of the Law. This oft-misunderstood phrase, which forms the basis for Crowley''s practice of Magick, is found in The Book of the Law. Dictated to Crowley in Cairo between noon and 1:00p.m. on three successive days in April 1904, The Book of the Law is the source book and key for Crowley students and for the occult in general. The holy text that forms the basis of Crowley''s belief system, Thelema, was transmitted to him by the entity known as Aiwass over the course of three fateful April days in 1904. With his wife Rose as the medium for what would become known as the Cairo Working, Crowley dutifully transcribed the communications on hotel stationery. This work contains the corrected text of the 1938 edition with a facsimile of the handwritten manuscript.',200,null,5);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (22,'Unglued: Making Wise Choices in the Midst of Raw Emotions','unglue.jpg','718093046',22,5,'978-0718093044',8.99,'God gave us emotions to experience life, not destroy it! Lysa TerKeurst admits that she, like most women, has had experiences where others bump into her happy and she comes emotionally unglued. We stuff, we explode, or we react somewhere in between. What do we do with these raw emotions? Is it really possible to make emotions work for us instead of against us? Yes, and in her usual inspiring and practical way, Lysa will show you how. Filled with gut-honest personal examples and biblical teaching, ',64,null,1);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (24,'The Russia Hoax: The Illicit Scheme to Clear Hillary Clinton and Frame Donald Trump','russia.jpg','62872745',31,14,'978-0062872746',4.71,'Fox News legal analyst Gregg Jarrett reveals the real story behind Hillary Clinton’s deep state collaborators in government and exposes their nefarious actions during and after the 2016 election.The Russia Hoax reveals how persons within the FBI and Barack Obama’s Justice Department worked improperly to help elect Hillary Clinton and defeat Donald Trump in the 2016 presidential election. When this suspected effort failed, those same people appear to have pursued a contrived investigation of President Trump in an attempt to undo the election results and remove him as president.',352,null,2);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (28,'A Merciful Death (Mercy Kilpatrick Book 1)','988-0135166307.jpg','B01EN506CO',1,25,'988-0135166307',15.6,'FBI special agent Mercy Kilpatrick has been waiting her whole life for disaster to strike. A prepper since childhood, Mercy grew up living off the land¿and off the grid¿in rural Eagle¿s Nest, Oregon. Until a shocking tragedy tore her family apart and forced her to leave home. Now a predator known as the cave man is targeting the survivalists in her hometown, murdering them in their homes, stealing huge numbers of weapons, and creating federal suspicion of a possible domestic terrorism event',928,null,4);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (1,'ABCs for Boys (Alphabet Book, Baby Book, Childrens Book, Toddler Book)','abcforboys.jpg','0692568409',19,5,'978-0692568408',10.8,'This one of a kind, hand illustrated alphabet book combines letters with all of boys favorite things airplanes, dump trucks, and more! Makes a special baby shower, birth, and birthday gift! Perfect for kids ages 0-5.',32,null,null);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (2,'Giraffes Cant Dance','giraffes.jpg','0545392551',20,5,'978-0545392556',5.06,'Giraffes Can''t Dance is a touching tale of Gerald the giraffe, who wants nothing more than to dance. With crooked knees and thin legs, it''s harder for a giraffe than you would think. Gerald is finally able to dance to his own tune when he gets some encouraging words from an unlikely friend.
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (3,'Where the Wild Things Are','wherethewildthingsare.jpg','0064431789',22,5,'978-0064431781',6.36,'Where the Wild Things Are is fifty years old! Maurice Sendak''s Caldecott Medal-winning picture book has become one of the most highly acclaimed and best-loved children''s books of all time. A must for every child''s bookshelf.
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (4,'The Very Hungry Caterpillar','veryhungrycaterpillar.jpg','0399226907',26,5,'978-0399226908',6.59,'THE all-time classic picture book, from generation to generation, sold somewhere in the world every 30 seconds! Have you shared it with a child or grandchild in your life?
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (5,'Willa of the Wood','willawoodrebert.jpg','1368005845',27,5,'978-1368005845',10.19,'To Willa, a young night-spirit, humans are the murderers of trees. She''s been taught to despise them and steal from them. She''s her clan''s best thief, creeping into the log cabins of the day-folk under cover of darkness and taking what they won''t miss. It''s dangerous work, but Willa will do anything to win the approval of the padaran, the charismatic leader of the Faeran people.',384,null,2);
