Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (7,'Measure What Matters: How Google, Bono, and the Gates Foundation','measure.jpg','525536221',22,3,'978-0525536222',16.2,'Legendary venture capitalist John Doerr reveals how the goal-setting system of Objectives and Key Results (OKRs) has helped tech giants from Intel to Google achieve explosive growth—and how it can help any organization thrive. ',320,null,4);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (9,'The South Beach Diet: The Delicious, Doctor-Designed','thesouthbeachdiet.jpg','312991193A',27,9,'978-0312991197',10.4,'For years, cardiologist Arthur Agatston, M.D., urged his patients to lose weight for the sake of their hearts, but every diet was too hard to follow or its restrictions were too harsh. Some were downright dangerous. Nobody seemed to be able to stick with low-fat regimens for any length of time. And a diet is useless if you can''t stick with it',384,null,2);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (10,'The Giving Tree','thegivingtree.jpg',null,22,5,'B00DB2QZPI',8.99,'The Giving Tree, a story of unforgettable perception, beautifully written and illustrated by the gifted and versatile Shel Silverstein, has been a classic favorite for generations.',64,null,3);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (12,'The Da Vinci Code','davincicode.jpg','307474275',18,2,'978-0307474278',12.14,'As millions of readers around the globe have already discovered, The Da Vinci Code is a reading experience unlike any other. Simultaneously lightning-paced, intelligent, and intricately layered with remarkable research and detail, Dan Brown''s novel is a thrilling masterpiece—from its opening pages to its stunning conclusion.',597,null,4);
Insert into BOOK (ID,NAME,HARDCOVERPATH,ISBN_10,PUBLISHERID,CATEGORYID,ISBN_13,PRICE,DESCRIPTION,PAGE,DELETEFLAG,QTYINSTOCK) values (16,'Brown Bear, Brown Bear, What Do You See?','brownbear.jpg','0805047905',25,5,'978-0805047905',7.34,'A big happy frog, a plump purple cat, a handsome blue horse, and a soft yellow duck--all parade across the pages of this delightful book. Children will immediately respond to Eric Carle''s flat, boldly colored collages. Combined with Bill Martin''s singsong text, they create unforgettable images of these endearing animals.',28,null,2);
