Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (22,42,27,'Java Data Mining is a book written for data mining practitioners. Even if the word Java appears in the title, practitioners of other languages or software may be interested by the first part of the book (Strategy), which is really worth reading. The other parts of the book focus on the JDM API itself (Standards), problem solving with case study (Practice) and finally evolution of standards in data mining (Wrapping Up).',to_date('10-AUG-18','DD-MON-RR'),1);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (23,18,2,'I have a three-year-old and he loves this book. I had been reading Dr. Seuss''''s ABC book to him for a while, and he''''d enjoyed the crazy drawings and fun rhymes that fill every Dr. Seuss book. But he''''d seemed to have gotten used to that one and while searching Amazon as his third B-Day neared I came across this one.',to_date('12-AUG-18','DD-MON-RR'),2);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (24,6,10,'My one and only complaint is why jack-o''''-lantern for j? Why not jacket or something. My nephew enjoyed spelling each and every page out to me but he struggled with that one',to_date('14-AUG-18','DD-MON-RR'),1);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (25,10,18,'Where the Wild Things Are is one of those truly rare books that can be enjoyed equally by a child and a grown-up. If you disagree, then it''''''''s been too long since you''''''''ve attended a wild rumpus. Max dons his wolf suit in pursuit of some mischief and gets sent to bed without supper. Fortuitously, a forest grows in his room, allowing his wild rampage to continue unimpaired. Sendak''''''''s color illustrations (perhaps his finest) are beautiful, and each turn of the page brings the discovery of a new wonder. ',to_date('04-AUG-18','DD-MON-RR'),5);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (26,2,2,'The wild things--with their mismatched parts and giant eyes--manage somehow to be scary-looking without ever really being scary; at times they''''''''re downright hilarious. Sendak''''''''s defiantly run-on sentences--one of his trademarks--lend the perfect touch of stream of consciousness to the tale, which floats between the land of dreams and a child''''''''s imagination. ',to_date('06-AUG-18','DD-MON-RR'),2);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (27,11,4,'This Sendak classic is more fun than you''''''''ve ever had in a wolf suit, and it manages to reaffirm the notion that there''''''''s no place like home. ',to_date('10-AUG-18','DD-MON-RR'),3);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (28,2,39,'I love this book! It''''s so creatively written and even makes me giggle. The critters behind the flaps make it even more exciting for my nephew.',to_date('06-AUG-18','DD-MON-RR'),2);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (29,10,13,'Good book. My daughter enjoys the lift the flap style. She has others that she prefers though.',to_date('13-AUG-18','DD-MON-RR'),5);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (30,20,21,'This is one of our favorite books. We have printed out pictures of each of the animals in the book, laminated them, and then hide them in my 3 year old''''s bedroom with a removable tacky putty. I move them around as she remembers where they are, but as we read the book, I ask her to find the animals. I also made her binoculars by putting colored paper around two toilet paper rolls that I hot glued together and attached a string at one end to go around her neck, when monitored. She loves it and it makes the book and story that much more enjoyable. The hard board book is very durable and great!',to_date('08-AUG-18','DD-MON-RR'),2);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (31,15,3,'This is the very best book I have come across to teach and gain the big picture of the effects of being kind. My 6 year old daughter finally gets it. I even wish I had this book as a kid! It is awesome!',to_date('07-AUG-18','DD-MON-RR'),1);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (32,12,21,'There''''s not much that hasn''''t been said about this timeless book. All I can say is I had never heard of it until my wife got pregnant and I began looking into books for babies/toddlers. This was at the top of my list after researching, and I''''m so happy to have purchased it. The art, wording, alternating black and white with color pages, and storyline are wonderful. It engages my son, he loves looking at the bunnies, and it truly is a calming book for everyone before bedtime. This was written over 60 years ago, so it makes you feel a bit like you''''re in a bygone era. Simplicity, values, family and education are all focused on in this book. We''''ve been reading it weekly for the past 20 months, and will continue to do so for another 40! I highly recommend this book, along with other Margaret Wise Brown books.',to_date('11-AUG-18','DD-MON-RR'),2);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (33,3,39,'I have been wanting this book FOREVER. It was picked as one of our Book of the Month selections at school so copies were ordered for everyone! So why is this book so uber cool in my opinion? It teaches kids ALL about their brains but most importantly:',to_date('08-AUG-18','DD-MON-RR'),5);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (34,34,24,'This review covers both Core Java Volume I--Fundamentals (9th Edition) and Core Java, Volume II--Advanced Features (9th Edition). Both books are part of the Prentice Hall Core Series.',to_date('07-AUG-18','DD-MON-RR'),2);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (35,34,37,'I actually got Volume II first and liked it so much I ordered Volume I. I felt like I was missing the first half of the story. Especially when I downloaded the code and both volumes were included.',to_date('11-AUG-18','DD-MON-RR'),4);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (36,35,4,'The book also lets you seen behind the scenes of Java programming in a way you possibly never have before, because Joshua Block is one of the developers behind Java itself, and all the main Oracle supported libraries. As such he can tell you that certain implementations in the standard Java libraries actually violate various best practices (either by accident or because those best practices hadn''''t emerged at the time of development). Almost always he will note that the problem cannot be fixed due to backward compatibility and has consequences to this day. Very few textbooks actually let you see inside details like this.',to_date('07-AUG-18','DD-MON-RR'),3);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (37,32,16,'Herbert Schildt is one of the best authors for Java, this updated edition is a must-have for any Java developer. A great reference book that covers the new Java 9 recently released.',to_date('13-AUG-18','DD-MON-RR'),5);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (38,32,21,'This Book Absolutely for Beginners:',to_date('06-AUG-18','DD-MON-RR'),3);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (39,30,20,'“Java Programming” covers all essential Java knowledge. You can learn complete primary skills of Java fast and easily. The book includes more than 80 practical examples for beginners and includes 100 tests & answers for the college exam, the engineer certification exam, and the job interview exam. ',to_date('14-AUG-18','DD-MON-RR'),2);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (40,35,34,'As someone who does not come from a computer science background but works as a software engineer, I''''ve had learning data structures and algorithms on my bucket list for quite some time. Working within the Ruby on Rails and SQL worlds has had me heavily shielded from the ideas and concepts of DS&A. My primary goal was to learn enough to pass the stereotypical Google/Amazon/Microsoft/Yahoo coding exam as well as conduct a similar engineering interview from the opposite end of the table. Since textbooks are my preferred way of learning, I set out in search of the DS&A book that would allow me to reach that goal.',to_date('01-AUG-18','DD-MON-RR'),5);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (41,35,9,'I am loving this book. I had some prior knowledge of Java and this book is making a lot more concepts clear that weren''''t that clear before. Thank you so much to the author. I plan to finish the book as soon as I can to appear for my OCA first and then my OCP exam.',to_date('02-AUG-18','DD-MON-RR'),4);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (42,31,18,'Really the best introductory Java book I ever have read!!!! Hope the authors can write more computer books like Advanced Java and more! I am able to pick up coding easily just by reading your books :)',to_date('05-AUG-18','DD-MON-RR'),4);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (43,30,26,'Appreciate it lots that the authors have produced such a masterpiece of writing! :)',to_date('05-AUG-18','DD-MON-RR'),1);
