Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (10,21,20,'There''''s not much that hasn''''t been said about this timeless book. All I can say is I had never heard of it until my wife got pregnant and I began looking into books for babies/toddlers. This was at the top of my list after researching, and I''''m so happy to have purchased it. The art, wording, alternating black and white with color pages, and storyline are wonderful. It engages my son, he loves looking at the bunnies, and it truly is a calming book for everyone before bedtime. This was written over 60 years ago, so it makes you feel a bit like you''''re in a bygone era. Simplicity, values, family and education are all focused on in this book. We''''ve been reading it weekly for the past 20 months, and will continue to do so for another 40! I highly recommend this book, along with other Margaret Wise Brown books.',to_date('14-AUG-18','DD-MON-RR'),4);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (11,26,12,'I have been wanting this book FOREVER. It was picked as one of our Book of the Month selections at school so copies were ordered for everyone! So why is this book so uber cool in my opinion? It teaches kids ALL about their brains but most importantly:',to_date('05-AUG-18','DD-MON-RR'),5);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (12,27,22,'This review covers both Core Java Volume I--Fundamentals (9th Edition) and Core Java, Volume II--Advanced Features (9th Edition). Both books are part of the Prentice Hall Core Series.',to_date('10-AUG-18','DD-MON-RR'),5);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (13,28,22,'I actually got Volume II first and liked it so much I ordered Volume I. I felt like I was missing the first half of the story. Especially when I downloaded the code and both volumes were included.',to_date('14-AUG-18','DD-MON-RR'),3);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (14,30,2,'The book also lets you seen behind the scenes of Java programming in a way you possibly never have before, because Joshua Block is one of the developers behind Java itself, and all the main Oracle supported libraries. As such he can tell you that certain implementations in the standard Java libraries actually violate various best practices (either by accident or because those best practices hadn''''t emerged at the time of development). Almost always he will note that the problem cannot be fixed due to backward compatibility and has consequences to this day. Very few textbooks actually let you see inside details like this.',to_date('14-AUG-18','DD-MON-RR'),2);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (15,31,24,'Herbert Schildt is one of the best authors for Java, this updated edition is a must-have for any Java developer. A great reference book that covers the new Java 9 recently released.',to_date('02-AUG-18','DD-MON-RR'),1);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (16,32,20,'This Book Absolutely for Beginners:',to_date('03-AUG-18','DD-MON-RR'),5);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (17,38,21,'“Java Programming” covers all essential Java knowledge. You can learn complete primary skills of Java fast and easily. The book includes more than 80 practical examples for beginners and includes 100 tests & answers for the college exam, the engineer certification exam, and the job interview exam. ',to_date('01-AUG-18','DD-MON-RR'),1);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (18,37,7,'As someone who does not come from a computer science background but works as a software engineer, I''''ve had learning data structures and algorithms on my bucket list for quite some time. Working within the Ruby on Rails and SQL worlds has had me heavily shielded from the ideas and concepts of DS&A. My primary goal was to learn enough to pass the stereotypical Google/Amazon/Microsoft/Yahoo coding exam as well as conduct a similar engineering interview from the opposite end of the table. Since textbooks are my preferred way of learning, I set out in search of the DS&A book that would allow me to reach that goal.',to_date('09-AUG-18','DD-MON-RR'),4);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (19,39,9,'I am loving this book. I had some prior knowledge of Java and this book is making a lot more concepts clear that weren''''t that clear before. Thank you so much to the author. I plan to finish the book as soon as I can to appear for my OCA first and then my OCP exam.',to_date('15-AUG-18','DD-MON-RR'),3);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (20,41,35,'Really the best introductory Java book I ever have read!!!! Hope the authors can write more computer books like Advanced Java and more! I am able to pick up coding easily just by reading your books :)',to_date('10-AUG-18','DD-MON-RR'),4);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (21,40,36,'Appreciate it lots that the authors have produced such a masterpiece of writing! :)',to_date('14-AUG-18','DD-MON-RR'),3);
Insert into REVIEW (ID,BOOKID,POSTERID,COMMENTS,CREATEDATE,RATING) values (47,2,45,'Good book for kids.',to_date('18-SEP-18','DD-MON-RR'),5);
