Young readers love lifting the flaps to discover the animals the zoo has sent-a monkey, a lion, and even an elephant! But will they ever find the perfect pet?',18,null,1);
Deep in the water,
Mr. Fish swims about
With his fish face stuck
In a permanent pout.
Can his pals cheer him up?
Will his pout ever end?
Is there something he can learn
From an unexpected friend?
Swim along with the pout-pout fish as he discovers that being glum and spreading "dreary wearies" isn''t really his destiny. Bright ocean colors and playful rhyme come together in Deborah Diesen''s fun fish story that''s sure to turn even the poutiest of frowns upside down.',34,null,3);
Make the world a better place: Beautiful hand-drawn illustrations accompany Cheri''s purposeful storytelling as she shows us once again how children can help to make the world a better place. Back pages include discussion questions, scenarios, games and role-play activities that help adults reinforce the book’s positive message.',48,null,3);
In a great green room, tucked away in bed, is a little bunny. "Goodnight room, goodnight moon." And to all the familiar things in the softly lit room—to the picture of the three little bears sitting on chairs, to the clocks and his socks, to the mittens and the kittens, to everything one by one—the little bunny says goodnight.
In this classic of children''s literature, beloved by generations of readers and listeners, the quiet poetry of the words and the gentle, lulling illustrations combine to make a perfect book for the end of the day.',30,null,2);
Written by an educator and psychologist, this fun and engaging introduction to the anatomy and functions of the brain will empower each young reader to S-T-R-E-T-C-H and grow their fantastic, elastic brain!',32,null,2);
Eugenie Clark fell in love with sharks from the first moment she saw them at the aquarium. She couldn''t imagine anything more exciting than studying these graceful creatures. But Eugenie quickly discovered that many people believed sharks to be ugly and scary?and they didn''t think women should be scientists. ',40,null,2);
It''s the one Java book that presents object-oriented features like inheritance, interfaces, and polymorphism in a way that''s both understandable and useful in the real world.
It offers new coverage of JavaFX, the date/time API, lambdas, and working with SQLite databases.',800,null,3);
Fully updated for Java Platform, Standard Edition 9 (Java SE 9), Java: A Beginner’s Guide, Seventh Edition, gets you started programming in Java right away. Bestselling programming author Herb Schildt begins with the basics, such as how to create, compile, and run a Java program. He then moves on to the keywords, syntax, and constructs that form the core of the Java language. The book also covers some of Java’s more advanced features, including multithreaded programming, generics, lambda expressions, Swing, and JavaFX. This practical Oracle Press guide features details on Java SE 9’s innovative new module system, and, as an added bonus, it includes an introduction to JShell, Java’s new interactive programming tool.',752,null,3);

The fact is your brain craves novelty. It''s constantly searching, scanning, waiting for something unusual to happen. After all, that''s the way it was built to help you stay alive. It takes all the routine, ordinary, dull stuff and filters it to the background so it won''t interfere with your brain''s real work--recording things that matter. How does your brain know what matters? It''s like the creators of the Head First approach say, suppose you''re out for a hike and a tiger jumps in front of you, what happens in your brain? Neurons fire. Emotions crank up. Chemicals surge. ',688,null,2);
The Oracle Java SE Certification track now consists of three levels – Associate (OCA), Professional (OCP), and Master (OCM). This valuable kit helps you attain success at the OCA and OCP levels, providing clarification of the complex material along with plenty of practice that covers all exam objectives.',1152,null,null);

A fundamentals-first introduction to basic programming concepts and techniques  
Designed to support an introductory programming course,  Introduction to Java Programming and Data Structures teaches you concepts of problem-solving and object-orientated programming using a fundamentals-first approach. Beginner programmers learn critical problem-solving techniques then move on to grasp the key concepts of object-oriented, GUI programming, data structures, and Web programming. This course approaches Java GUI programming using JavaFX, which has replaced Swing as the new GUI tool for developing cross-platform-rich Internet applications and is simpler to learn and use. The 11th edition has been completely revised to enhance clarity and presentation, and includes new and expanded content, examples, and exercises. ',1232,null,4);
This book will help you learn the tools and techniques in Java to conduct data analysis without any hassle. After getting a quick overview of what data science is and the steps involved in the process, you''ll learn the statistical data analysis techniques and implement them using the popular Java APIs and libraries. Through practical examples, you will also learn the machine learning concepts such as classification and regression.',412,0,4);

