--------------------------------------------------------
--  Procedure AddShipDetailByOrderId
--------------------------------------------------------
create or replace 
PROCEDURE AddShipDetailByOrderId(V_ORDER_ID NUMBER)
AS
    
        Cursor C Is
            Select Id, Quantity, Bookid From Order_Detail Where Orderid= V_Order_Id;
        detailRow C%ROWTYPE;   
Begin
    FOR detailRow IN C
    LOOP
      Addshipdetailbyorderdetailid(Detailrow.Id);
      update Book set Qtyinstock=qtyinStock - detailRow.quantity where id=detailRow.bookid;
    END LOOP;

END;
---------------------------------------------------------
---- Procedure Addshipdetailbyorderdetailid
---------------------------------------------------------
create or replace 
PROCEDURE AddShipDetailByOrderDetailId(V_ORDER_DETAIL_ID NUMBER)
AS
    
        CURSOR C IS
            SELECT A.* FROM (
               SELECT I.BOOKID, BARCODE, RANK() OVER (PARTITION BY BOOKID ORDER BY BARCODE) AS RANK
               FROM INVENTORY I 
               WHERE  i.isavailable=1 
            ) A INNER JOIN ORDER_DETAIL OD ON A.BOOKID=od.bookid
            WHERE A.RANK<=od.quantity AND OD.ID= V_ORDER_DETAIL_ID;
        ITEM c%rowtype;   
BEGIN
    FOR ITEM IN C
    LOOP
        VALUES (V_ORDER_DETAIL_ID, ITEM.BARCODE);
        Update Inventory Set Isavailable= 0 Where Barcode= Item.Barcode;
        
    END LOOP;

END;
