-----------------------------------------------------------
---- Procedure SavePriceHistory
-----------------------------------------------------------

create or replace PROCEDURE SavePriceHistory(
    v_bookId in Price_History.bookid%type,
    v_invoice in Price_History.INVOICEPRICE%type, 
    v_sell in PRICE_HISTORY.SELLPRICE%type)
AS
        num_record int;
BEGIN
   SELECT  count(*) into num_record FROM PRICE_HISTORY WHERE BOOKID=v_bookid and enddate is null;
        -- This is new book, don't have any record in history
        IF(num_record=0) THEN
                DBMS_OUTPUT.PUT('This is new book, just insert new record');
                VALUES( v_bookId, trunc(sysdate), v_invoice,  v_sell,trunc( sysdate));
        ELSE
            -- This is old book
                DBMS_OUTPUT.PUT('This is old book, just update with new invoice price or sellprice if user update price in the same date ');
                SELECT   count(*) into num_record 
                FROM PRICE_HISTORY 
                 WHERE BOOKID= v_bookId  and ENDDATE is null AND trunc(startdate)=trunc(sysdate);
          
                     --if change value today again
                IF(num_record=1) THEN

                         UPDATE PRICE_HISTORY SET INVOICEPRICE= v_invoice, SELLPRICE= v_sell where  BOOKID= v_bookId  and ENDDATE is null and startdate=trunc(sysdate);
              ELSE
              --else  book have  the difference invoice and sell price apply for today, then insert new 
                             UPDATE PRICE_HISTORY SET ENDDATE= trunc(sysdate-1) where  BOOKID= v_bookId  and ENDDATE is null ;
                            VALUES( v_bookId, trunc(sysdate), v_invoice, v_sell, trunc(sysdate));
              END IF;                    
         End If ;
END;